import React from 'react';
import Sidebar from '../Sidebar';
import Content from '../Content';

const index = () => {
    return (
        <div className='layout'>
            <div className='wrapper'>
                <Sidebar />
                <Content />
            </div>
        </div>
    )
}

export default index
